&gt; Being injured didn&#39;t mean that Tucson was ready to give up.  But he knew he
&gt; had to take his time and not jump to conclusions.  Attacking whoever was
&gt; coming was not a good idea, but remaining alert was.  He tests the air with
&gt; his nostrils and listens carefully as to what is approaching him.  He shifts
&gt; his weight and gets onto his four feet in preparation to move if he had to.
&gt; Yet he wanted the approachers to know that he was no small creature.  He
&gt; rumbles a  deep draconic growl just to give the approachers an idea what
&gt; they were coming close to.

&lt;NEW&gt;

There are quiet voices, &quot;He&#39;s not dead.&quot; One voice said from one of
the figures approaching.

&quot;I can hear plain as you.&quot; Said another.

There was a third voice, &quot;He is not out but he is injured. Spread out
and we will take him from all sides.&quot;

&quot;Sir.&quot; Came the answering replies.

Three individuals began spreading out to surround TUSCON on three
sides, TUSCON&#39;s keen senses helping him to keep track of their
position as they came around. Their size was difficult to make out
with all the brush and such between TUSCON and the ones trying to
surround him but they did seem to be on the large size, but not on the
order of the dinobots, but then again how many were?

